    flex-direction: column;
    align-items: center;
    gap: 20px;
    padding-top: 20px;
`
const Block = styled.div`
    width: 1248px;
    height: ${({ $Height }) => ($Height ? '556px' : '267px')};
    background-color: ${({ $Fon }) => ($Fon ? '#D5DEF6' : '#E2EDD0')};
`
const LabaStud = () => {
    return ( 
        <>
            <Section>
                <Block $Height $Fon>

                </Block>
                <Block >

                </Block>
                <div>

                </div>
            </Section>
        </>
     );
}

export default LabaStud;
